    this.setState({ passengers: event.target.value }, () => {
      console.log(this.state.passengers);

      let demobool = false;
      let legarray = [];
      let coordinateArray = [];

      let loopervar = this.state.airportsinvolved;

      for (let key2 = 0; key2 < loopervar; key2++) {
