      this.setState({ legs: templegs }, () => {
        console.log(this.state.legs);
      });

      let demobool = false;
      let legarray = [];
      let loopervar = this.state.airportsinvolved;
      let coordinateArray = [];

      for (let key2 = 0; key2 < loopervar; key2++) {
