              () => {
                console.log("worked gg");
                console.log(this.state.emissions);
              }
            );
          }
        );
      }
    }
  };

  handleYesFlightNumber = () => {
    this.setState({ isFlightNumber: "yes" }, () => {
      console.log(this.state.isFlightNumber)
    });
  };

  handleNoFlightNumber = () => {
    this.setState({ isFlightNumber: "no"}, () => {
      console.log(this.state.isFlightNumber)
    })
  } 

  render() {
    let addedlegone = "";
    if (this.state.airportsinvolved >= 3) {
      addedlegone = (
        <Autocomplete
          disablePortal
          id="airport-leg3-autofill"
          autoHighlight
          getOptionLabel={(option) => `${option.name} (${option.code})`}
          options={airportlist}
          sx={{ width: "auto" }}
          renderOption={(props, option) => (
            <Box component="li" {...props}>
              {option.name} {option.city} <b>{option.code}</b>
            </Box>
          )}
          onChange={this.handleAddedLeg}
          renderInput={(params) => (
            <TextField {...params} label={this.state.airportthree} />
          )}
        />
      );
    }

    let addedfinalleg = "";
    if (this.state.airportsinvolved >= 4) {
      addedfinalleg = (
        <Autocomplete
          disablePortal
